import React from 'react';
import ReactDOM from 'react-dom/client';
import './MAIN'

function Users() {
    return (
        <div class="App">
            <div class="page_events"></div>
            <div class="page_events2"></div>

            <div class="back_btn">
                <a href="index.html" class="back_btn_link">Назад</a>
            </div>
            <header class="header"></header>
            <main class="main">
                <div class="conteiner users_conteiner"></div>
            </main>
        </div>
    )
}
export default Users;
